import React from "react";

export const Map = () => {
  return (
    <div className="map">
      <iframe
        width="auto"
        height="auto"
        id="gmap_canvas"
        src="https://maps.google.com/maps?q=Living%20Skies%20Window%20Tint&t=&z=13&ie=UTF8&iwloc=&output=embed"
        frameborder="0"
        scrolling="yes"
        marginheight="0"
        marginwidth="0"
      ></iframe>
    </div>
  );
};
